### Summary of Core Topics and Concepts

#### 1. Python Basics
- **Input/Output Handling**: Using `input()` and `print()` functions.
- **Loops**: `for` and `while` loops.
- **Conditionals**: `if`, `elif`, and `else` statements.
- **String Manipulation**: Iterating through strings, checking for substrings.
- **Lists**: Basic operations and iterations.

#### 2. Python Functions and Operators
- **Range Function**: Understanding `range(start, stop, step)`.
- **Floor Division Operator**: Using `//` for integer division.
- **Membership Operators**: Using `in` to check for membership in lists and strings.

#### 3. Pattern Printing
- **Nested Loops**: Using nested loops to print patterns.
- **String Concatenation**: Building strings dynamically.

#### 4. Mathematical Concepts
- **Minimum of Three Numbers**: Logical conditions to find the minimum.
- **Fibonacci Sequence**: Generating Fibonacci numbers using loops.

#### 5. Special Numbers
- **Narcissistic Numbers**: Checking if a number is equal to the sum of its own digits each raised to the power of the number of digits.

#### 6. String Slicing
- **Substring Extraction**: Using slicing to extract substrings from a string.

### Core Equations and Concepts

#### Mathematical Equations
- **Fibonacci Sequence**:
  \[
  F(n) = F(n-1) + F(n-2)
  \]
  where \( F(0) = 0 \) and \( F(1) = 1 \).

- **Narcissistic Number**:
  \[
  \text{val} = \sum_{i=0}^{n-1} d_i^m
  \]
  where \( d_i \) are the digits of the number and \( m \) is the number of digits.

